    return (
        <DropdownContainer>
            <Icon>
                <CloseIcon />
            </Icon>
            <DropdownWrapper>
                <DropdownMenu>

                </DropdownMenu>
            </DropdownWrapper>

        </DropdownContainer>
    );
};

export default Dropdown;
